  false,\n\t\"url\": null,\n\t\"notes\": \"Third leg of the ru29 Challenger mission
  from Brazil to South Africa. The Challenger Mission is a re-creation of the first
  global scientific ocean survey conducted by the HMS Challenger in 1872. A fleet
  of up to 16 autonomous underwater gliders will be deployed in all five ocean basins.
  The goals of the project are the spread ocean literacy, educate the general population
  about the ocean's impact on global climate and provide real-time temperature, salinity
  and density profiles for assimilation into regional and global weather forecasting
  models.nnThe National Centers for Environmental Information (NCEI) received the
  data in this archival package from the Integrated Ocean Observing System's National
  Glider Data Assembly Center (IOOS NGDAC). The IOOS NGDAC received the data in one
  or more netCDF files comprising an entire glider deployment. The data are measurements
  of physical oceanographic properties such as temperature, salinity, conductivity,
  and density. The IOOS NGDAC checked the files for compliance to their netCDF file
  convention, aggregated the files into a single netCDF file, and then submitted the
  file to NCEI for long-term preservation.\",\n\t\"license_title\": null,\n\t\"extras\":
